jQuery(document).ready(function($) {
    $("#saveForm").click(function(){
        $first_name = $('#Field1').val();
        $last_name = $('#Field2').val();
        $email = $('#Field3').val();
        $company_name = $('#Field5').val();
        $id = $email;
         // the user ID from your database
        var userID = $id;
        var properties = {
            id: userID,
            first_name: $first_name,
            last_name: $last_name,
            email: $id,
            company_name: $company_name
        };
        _gs('identify', userID, properties);
    });
});

_gs('properties', props);

